import React from 'react';
import {Link} from 'react-router-dom'

function Error() {
    return (
        <div className="error">
            <h1>That URL doesn't look right.</h1>
            <Link to="/">
                <button className="stylish">Back to Home</button>
            </Link>
        </div>
    )
}

export default Error
